import React, { Component } from 'react';
import Nav from '../components/Nav'
import  CardProfile from "../components/CardProfile";
import ExpandMoreIcon from '@material-ui/icons/ExpandMore';
import {Container,Row,Col} from 'react-bootstrap/'
import  Search from "../components/Search";
import {
    MainButton, GreenButton
  } from "../components/Atribut";
class BookmarkAntrian extends Component {
    render() {
        return (
            <div>
                <Nav/>
                <Container>
                    <Row className="wrapper" href="#talent">
                        <h4>Selamat Datang</h4>

                        <div className="ml-auto">
                            <GreenButton className="list">Cari</GreenButton>
                            <Search className="list"></Search>
                        </div>
                    </Row>
                </Container>
                <Container className="mt-5">
                    <CardProfile/>
                </Container>

                <Container className="mt-5">
                    <CardProfile/>
                </Container>

                <Container className="mt-5">
                    <CardProfile/>
                </Container>
            </div>
        );
    }
}

export default BookmarkAntrian;
